DROP TABLE CCAUDITLOG
/
CREATE TABLE CCAUDITLOG
(
    LOGNO                          NUMBER(9,0) NOT NULL,
    COMPANYCD                      VARCHAR2(6),
    USERID                         VARCHAR2(10),
    EXECUTEDATE                    TIMESTAMP NOT NULL,
    IPADDRESS                      VARCHAR2(60),
    URI                            VARCHAR2(1024),
    ACCESSRESULT                   VARCHAR2(20),
    LOGINLEVEL                     VARCHAR2(1),
    PROGRAMID                      VARCHAR2(9),
    OPERATIONID                    VARCHAR2(30),
    OPERATIONINFO                  VARCHAR2(1024),
    CONSTRAINT CCAUDITLOG_I0 PRIMARY KEY (LOGNO) USING INDEX
)
/
COMMENT ON TABLE CCAUDITLOG IS '監査ログ情報'
/
COMMENT ON COLUMN CCAUDITLOG.LOGNO IS 'ログNO'
/
COMMENT ON COLUMN CCAUDITLOG.COMPANYCD IS '会社コード'
/
COMMENT ON COLUMN CCAUDITLOG.USERID IS 'ユーザID'
/
COMMENT ON COLUMN CCAUDITLOG.EXECUTEDATE IS '実行日時'
/
COMMENT ON COLUMN CCAUDITLOG.IPADDRESS IS 'IPアドレス'
/
COMMENT ON COLUMN CCAUDITLOG.URI IS 'アクセスURI'
/
COMMENT ON COLUMN CCAUDITLOG.ACCESSRESULT IS 'アクセス成功フラグ'
/
COMMENT ON COLUMN CCAUDITLOG.LOGINLEVEL IS 'ログインレベル'
/
COMMENT ON COLUMN CCAUDITLOG.PROGRAMID IS 'プログラムID'
/
COMMENT ON COLUMN CCAUDITLOG.OPERATIONID IS '処理ID'
/
COMMENT ON COLUMN CCAUDITLOG.OPERATIONINFO IS '操作内容'
/

--exit
DROP TABLE CCCODE
/
CREATE TABLE CCCODE
(
    COMPANYCD                      VARCHAR2(6) NOT NULL,
    CODEKBN                        VARCHAR2(5) NOT NULL,
    CODE1                          VARCHAR2(20) NOT NULL,
    CODE2                          VARCHAR2(20) NOT NULL,
    CODE3                          VARCHAR2(20) NOT NULL,
    INSDATE                        TIMESTAMP NOT NULL,
    INSUSRID                       VARCHAR2(10) NOT NULL,
    INSPGID                        VARCHAR2(30) NOT NULL,
    UPDDATE                        TIMESTAMP,
    UPDUSRID                       VARCHAR2(10),
    UPDPGID                        VARCHAR2(30),
    REVISION                       NUMBER(7,0) NOT NULL,
    CONTENT1                       VARCHAR2(100),
    CONTENT2                       VARCHAR2(100),
    CONTENT3                       VARCHAR2(100),
    CONTENT4                       VARCHAR2(100),
    CONTENT5                       VARCHAR2(100),
    CONTENT6                       VARCHAR2(100),
    CONTENT7                       VARCHAR2(100),
    CONTENT8                       VARCHAR2(100),
    CONTENT9                       VARCHAR2(100),
    CONSTRAINT CCCODE_I0 PRIMARY KEY (COMPANYCD, CODEKBN, CODE1, CODE2, CODE3) USING INDEX
)
/
COMMENT ON TABLE CCCODE IS 'コードマスタ'
