CREATE TABLE CTANKEN
(
    COMPANYCD                      VARCHAR2(6) NOT NULL,
    ANKENID                        VARCHAR2(7) NOT NULL,
    INSDATE                        TIMESTAMP NOT NULL,
    INSUSRID                       VARCHAR2(10) NOT NULL,
    INSPGID                        VARCHAR2(30) NOT NULL,
    UPDDATE                        TIMESTAMP,
    UPDUSRID                       VARCHAR2(10),
    UPDPGID                        VARCHAR2(30),
    REVISION                       NUMBER(7,0) NOT NULL,
    ANKENNM                        VARCHAR2(120),
    ANKENKBN                       VARCHAR2(2),
    ANKENKAISHIBI                  DATE,
    KOKYAKUID                      VARCHAR2(6),
    BIKO                           VARCHAR2(150),
    CONSTRAINT CTANKEN_I0 PRIMARY KEY (COMPANYCD, ANKENID) USING INDEX
)
/
COMMENT ON TABLE CTANKEN IS '案件台帳'
/
COMMENT ON COLUMN CTANKEN.COMPANYCD IS '会社コード'
/
COMMENT ON COLUMN CTANKEN.ANKENID IS '案件ID'
/
COMMENT ON COLUMN CTANKEN.INSDATE IS '登録日時'
/
COMMENT ON COLUMN CTANKEN.INSUSRID IS '登録者ID'
/
COMMENT ON COLUMN CTANKEN.INSPGID IS '登録PGID'
/
COMMENT ON COLUMN CTANKEN.UPDDATE IS '更新日時'
/
COMMENT ON COLUMN CTANKEN.UPDUSRID IS '更新者ID'
/
COMMENT ON COLUMN CTANKEN.UPDPGID IS '更新PGID'
/
COMMENT ON COLUMN CTANKEN.REVISION IS 'REVISION'
/
COMMENT ON COLUMN CTANKEN.ANKENNM IS '案件名称'
/
COMMENT ON COLUMN CTANKEN.ANKENKBN IS '案件区分'
/
COMMENT ON COLUMN CTANKEN.ANKENKAISHIBI IS '案件開始日'
/
COMMENT ON COLUMN CTANKEN.KOKYAKUID IS '顧客ID'
/
COMMENT ON COLUMN CTANKEN.BIKO IS '備考'
/
