CREATE TABLE CTHOMONKIROKU
(
    COMPANYCD                      VARCHAR2(6) NOT NULL,
    EIGYOTANTOCD                   VARCHAR2(10) NOT NULL,
    HOMONDATE                      TIMESTAMP NOT NULL,
    INSDATE                        TIMESTAMP NOT NULL,
    INSUSRID                       VARCHAR2(10) NOT NULL,
    INSPGID                        VARCHAR2(30) NOT NULL,
    UPDDATE                        TIMESTAMP,
    UPDUSRID                       VARCHAR2(10),
    UPDPGID                        VARCHAR2(30),
    REVISION                       NUMBER(7,0) NOT NULL,
    EIGYOBUMONCD                   VARCHAR2(6) NOT NULL,
    KOKYAKUID                      VARCHAR2(6) NOT NULL,
    KOKYAKUTANTONM                 VARCHAR2(15),
    TAIZAIJIKAN                    NUMBER(2,1),
    HOMONNAIYO                     VARCHAR2(100),
    CONSTRAINT CTHOMONKIROKU_I0 PRIMARY KEY (COMPANYCD, EIGYOTANTOCD, HOMONDATE) USING INDEX
)
/
COMMENT ON TABLE CTHOMONKIROKU IS '顧客訪問記録'
/
COMMENT ON COLUMN CTHOMONKIROKU.COMPANYCD IS '会社コード'
/
