/
COMMENT ON COLUMN CTHOMONKIROKU.INSPGID IS '登録PGID'
/
COMMENT ON COLUMN CTHOMONKIROKU.UPDDATE IS '更新日時'
/
COMMENT ON COLUMN CTHOMONKIROKU.UPDUSRID IS '更新者ID'
/
COMMENT ON COLUMN CTHOMONKIROKU.UPDPGID IS '更新PGID'
/
COMMENT ON COLUMN CTHOMONKIROKU.REVISION IS 'REVISION'
/
COMMENT ON COLUMN CTHOMONKIROKU.EIGYOBUMONCD IS '営業部門コード'
/
COMMENT ON COLUMN CTHOMONKIROKU.KOKYAKUID IS '顧客ID'
/
COMMENT ON COLUMN CTHOMONKIROKU.KOKYAKUTANTONM IS '顧客担当者名'
/
