CREATE TABLE CTMBUMON
(
    COMPANYCD                      VARCHAR2(6) NOT NULL,
    BUMONCD                        VARCHAR2(6) NOT NULL,
    INSDATE                        TIMESTAMP NOT NULL,
    INSUSRID                       VARCHAR2(10) NOT NULL,
    INSPGID                        VARCHAR2(30) NOT NULL,
    UPDDATE                        TIMESTAMP,
    UPDUSRID                       VARCHAR2(10),
    UPDPGID                        VARCHAR2(30),
    REVISION                       NUMBER(7,0) NOT NULL,
    BUMONNM                        VARCHAR2(30) NOT NULL,
    BUMONKBN                       VARCHAR2(1) NOT NULL,
    CONSTRAINT CTMBUMON_I0 PRIMARY KEY (COMPANYCD, BUMONCD) USING INDEX
)
/
COMMENT ON TABLE CTMBUMON IS '部門マスタ'
/
COMMENT ON COLUMN CTMBUMON.COMPANYCD IS '会社コード'
/
COMMENT ON COLUMN CTMBUMON.BUMONCD IS '部門コード'
/
COMMENT ON COLUMN CTMBUMON.INSDATE IS '登録日時'
/
COMMENT ON COLUMN CTMBUMON.INSUSRID IS '登録者ID'
/
COMMENT ON COLUMN CTMBUMON.INSPGID IS '登録PGID'
/
COMMENT ON COLUMN CTMBUMON.UPDDATE IS '更新日時'
/
COMMENT ON COLUMN CTMBUMON.UPDUSRID IS '更新者ID'
/
COMMENT ON COLUMN CTMBUMON.UPDPGID IS '更新PGID'
/
COMMENT ON COLUMN CTMBUMON.REVISION IS 'REVISION'
/
COMMENT ON COLUMN CTMBUMON.BUMONNM IS '部門名称'
/
COMMENT ON COLUMN CTMBUMON.BUMONKBN IS '部門区分'
/
