DROP TABLE CTPHASE
/
CREATE TABLE CTPHASE
(
    COMPANYCD                      VARCHAR2(6) NOT NULL,
    ANKENID                        VARCHAR2(7) NOT NULL,
    SEISAKUNO                      VARCHAR2(3) NOT NULL,
    PHASEKBN                       VARCHAR2(2) NOT NULL,
    INSDATE                        TIMESTAMP NOT NULL,
    INSUSRID                       VARCHAR2(10) NOT NULL,
    INSPGID                        VARCHAR2(30) NOT NULL,
    UPDDATE                        TIMESTAMP,
    UPDUSRID                       VARCHAR2(10),
    UPDPGID                        VARCHAR2(30),
    REVISION                       NUMBER(7,0) NOT NULL,
    PHASEKAISHIBI                  DATE,
    PHASESHURYOBI                  DATE,
    SHINCHOKU                      VARCHAR2(30),
    BIKO                           VARCHAR2(150),
    CONSTRAINT CTPHASE_I0 PRIMARY KEY (COMPANYCD, ANKENID, SEISAKUNO, PHASEKBN) USING INDEX
)
/
COMMENT ON TABLE CTPHASE IS 'フェーズ実績'
/
COMMENT ON COLUMN CTPHASE.COMPANYCD IS '会社コード'
/
COMMENT ON COLUMN CTPHASE.ANKENID IS '案件ID'
/
COMMENT ON COLUMN CTPHASE.SEISAKUNO IS '製作NO'
/
COMMENT ON COLUMN CTPHASE.PHASEKBN IS 'フェーズ区分'
/
COMMENT ON COLUMN CTPHASE.INSDATE IS '登録日時'
/
COMMENT ON COLUMN CTPHASE.INSUSRID IS '登録者ID'
/
COMMENT ON COLUMN CTPHASE.INSPGID IS '登録PGID'
/
COMMENT ON COLUMN CTPHASE.UPDDATE IS '更新日時'
/
COMMENT ON COLUMN CTPHASE.UPDUSRID IS '更新者ID'
/
COMMENT ON COLUMN CTPHASE.UPDPGID IS '更新PGID'
/
COMMENT ON COLUMN CTPHASE.REVISION IS 'REVISION'
/
COMMENT ON COLUMN CTPHASE.PHASEKAISHIBI IS 'フェーズ開始日'
/
COMMENT ON COLUMN CTPHASE.PHASESHURYOBI IS 'フェーズ終了日'
/
COMMENT ON COLUMN CTPHASE.SHINCHOKU IS '進捗状況'
/
