CREATE TABLE CTSEISAKU
(
    COMPANYCD                      VARCHAR2(6) NOT NULL,
    ANKENID                        VARCHAR2(7) NOT NULL,
    SEISAKUNO                      VARCHAR2(3) NOT NULL,
    INSDATE                        TIMESTAMP NOT NULL,
    INSUSRID                       VARCHAR2(10) NOT NULL,
    INSPGID                        VARCHAR2(30) NOT NULL,
    UPDDATE                        TIMESTAMP,
    UPDUSRID                       VARCHAR2(10),
    UPDPGID                        VARCHAR2(30),
    REVISION                       NUMBER(7,0) NOT NULL,
    SEISAKUNM                      VARCHAR2(120) NOT NULL,
    JUCHUBI                        DATE,
    SEISAKUKAISHIBI                DATE,
    SEISAKUSHURYOBI                DATE,
    EIGYOBUMONCD                   VARCHAR2(6),
    EIGYOTANTOCD                   VARCHAR2(10),
    KAIHATSUBUMONCD                VARCHAR2(6),
    KAIHATSUTANTOCD                VARCHAR2(10),
    BIKO                           VARCHAR2(150),
    CONSTRAINT CTSEISAKU_I0 PRIMARY KEY (COMPANYCD, ANKENID, SEISAKUNO) USING INDEX
)
/
COMMENT ON TABLE CTSEISAKU IS '製作台帳'
/
COMMENT ON COLUMN CTSEISAKU.COMPANYCD IS '会社コード'
/
COMMENT ON COLUMN CTSEISAKU.ANKENID IS '案件ID'
/
COMMENT ON COLUMN CTSEISAKU.SEISAKUNO IS '製作NO'
/
COMMENT ON COLUMN CTSEISAKU.INSDATE IS '登録日時'
/
COMMENT ON COLUMN CTSEISAKU.INSUSRID IS '登録者ID'
/
COMMENT ON COLUMN CTSEISAKU.INSPGID IS '登録PGID'
/
COMMENT ON COLUMN CTSEISAKU.UPDDATE IS '更新日時'
/
COMMENT ON COLUMN CTSEISAKU.UPDUSRID IS '更新者ID'
/
COMMENT ON COLUMN CTSEISAKU.UPDPGID IS '更新PGID'
/
COMMENT ON COLUMN CTSEISAKU.REVISION IS 'REVISION'
/
COMMENT ON COLUMN CTSEISAKU.SEISAKUNM IS '製作名称'
/
COMMENT ON COLUMN CTSEISAKU.JUCHUBI IS '受注日'
/
COMMENT ON COLUMN CTSEISAKU.SEISAKUKAISHIBI IS '製作開始日'
/
COMMENT ON COLUMN CTSEISAKU.SEISAKUSHURYOBI IS '製作終了日'
/
COMMENT ON COLUMN CTSEISAKU.EIGYOBUMONCD IS '営業部門コード'
/
