    INSDATE                        TIMESTAMP NOT NULL,
    INSUSRID                       VARCHAR2(10) NOT NULL,
    INSPGID                        VARCHAR2(30) NOT NULL,
    UPDDATE                        TIMESTAMP,
    UPDUSRID                       VARCHAR2(10),
    UPDPGID                        VARCHAR2(30),
    REVISION                       NUMBER(7,0) NOT NULL,
    MITSUMORIKINGAKU               NUMBER(10,0),
    JUCHUKINGAKU                   NUMBER(10,0),
    SEIZOGENKA                     NUMBER(10,0),
    ARARIGAKU                      NUMBER(10,0),
    ARARIRITSU                     NUMBER(5,2),
