    KAIHATSUBUMONCD                VARCHAR2(6),
    KAIHATSUTANTOCD                VARCHAR2(10),
    BIKO                           VARCHAR2(150),
    CONSTRAINT CTSEISAKUH_I0 PRIMARY KEY (COMPANYCD, ANKENID, SEISAKUNO) USING INDEX
)
