CREATE OR REPLACE VIEW CVCODE
AS
SELECT COMPANYCD, CODEKBN, CODE1, CODE2, CODE3
     , INSDATE, INSUSRID, INSPGID, UPDDATE, UPDUSRID, UPDPGID, REVISION
     , CONTENT1, CONTENT2, CONTENT3, CONTENT4, CONTENT5
     , CONTENT6, CONTENT7, CONTENT8, CONTENT9
  FROM CCCODE
 ORDER BY COMPANYCD, CODEKBN, CODE1, CODE2, CODE3
